import React from "react";
import Header from "parts/Header";
import Hero from "parts/Hero";
import JustArrived from "parts/HomaPage/JustArrived";
import BrowseTheRoom from "parts/HomaPage/BrowseTheRoom";
import Clients from "parts/HomaPage/Clients";


export default function HomePage(props) {
  return (
    <>
      <Header />
      <Hero />
      <BrowseTheRoom />
      <Clients />
     
    </>
  );
}
